clear all; close all; clc;
%[text] ![](text:image:4694)
%[text] 
%%
%[text] 初始化参数和状态
tic;

global params states_r

fprintf('1. 初始化参数和状态...\n'); %[output:882911f9]
params = init_params(); 
states_r = struct();
Y0 = init_Y();

toc; %[output:070f4b87]
%%
%[text] 仿真设置
tic;

fprintf('仿真设置...\n'); %[output:53f05961]

t_total = 5.0; % s
flash_start = 0.5; % s
flash_duration = 0.02; % s
light_intensities = [1.7, 4.8, 15.2, 39.4, 125, 444, 1406, 4630];

% 添加光刺激参数到params结构体
params.flash_start = flash_start;
params.flash_duration = flash_duration;
params.stimulus = 0; % 初始为0

% ODE 求解器选项 - 使用更严格的容差
options = odeset('RelTol', 1e-6, 'AbsTol', 1e-9, ...
                 'MaxStep', 0.001, ...  % 限制最大步长
                 'InitialStep', 1e-6);  % 使用小的初始步长

% options = odeset('RelTol', 1e-6, 'AbsTol', 1e-9, ...
%                  'MaxStep', 0.001, ...  % 限制最大步长
%                  'InitialStep', 1e-6);  % 使用小的初始步长

toc; %[output:336829c4]
%%
%[text] 寻找暗环境稳态 （可选）
tic;

fprintf('2. 寻找暗环境稳态...\n'); %[output:82a7bb92]
params.Jhv = 0;

dark_results = cell(1, 1);
dark_t_results = cell(1, 1);

% 分步达到稳态，避免数值不稳定
[t_ss1, Y_ss1] = ode15s(@dY_dt, [0 0.1], Y0, options);
[t_ss2, Y_ss2] = ode15s(@dY_dt, [0.1 1], Y_ss1(end,:), options);
[t_ss3, Y_ss3] = ode15s(@dY_dt, [1 5], Y_ss2(end,:), options);
% [t_ss3, Y_ss3] = ode15s(@dY_dt, [1 300], Y_ss2(end,:), options);
Y_steady_state = Y_ss3(end, :);

% 保存Y_steady_state
save('Y_steady_state.mat', 'Y_steady_state');

% 暗稳态结果
dark_t_results{1} = t_ss3;
dark_results{1} = unpack_solution_to_results(t_ss3, Y_ss3, 0);
% analyze_and_print_results(dark_results, dark_t_results, 0);
plot_final_results_figure(dark_results, dark_t_results,[0, 5]); %[output:1cd1b488]

% 稳态验证
steady_state_check = struct();
steady_state_check.Vm = Y_steady_state(1);
steady_state_check.cGMP = Y_steady_state(18);
steady_state_check.Caos = Y_steady_state(9);
steady_state_check.Cais = Y_steady_state(10);
steady_state_check.Ki = Y_steady_state(6);
steady_state_check.Nai = Y_steady_state(7);

fprintf('\n稳态检查：\n'); %[output:925c0547]
fprintf('  Vm = %.2f mV (期望?: -40 mV)\n', steady_state_check.Vm); %[output:2774e8c0]
fprintf('  cGMP = %.2f μM (期望?: 6.5 μM)\n', steady_state_check.cGMP); %[output:79872a8c]
fprintf('  Caos = %.3f μM (期望?: 0.25 μM)\n', steady_state_check.Caos); %[output:018df1aa]
fprintf('  Cais = %.3f μM (期望?: 0.1 μM)\n', steady_state_check.Cais); %[output:8c59deab]
fprintf('  Ki = %.1f mM (期望?: 140 mM)\n', steady_state_check.Ki); %[output:596a5361]
fprintf('  Nai = %.1f mM (期望?: 5-15 mM)\n', steady_state_check.Nai); %[output:17992c56]

% 计算暗电流
currents_ss = cal_ion_currents();
fprintf('  暗电流 = %.2f pA (期望: ~-20 pA)\n', currents_ss.I_CNG + currents_ss.I_NCKX); %[output:3b966c7b]
fprintf('   稳态达成！\n\n'); %[output:297a6025]

toc; %[output:551f1786]
%%
%[text] 循环运行不同光强的仿真
tic;

fprintf('3. 开始进行光响应仿真...\n'); %[output:4675ea65]
load('Y_steady_state.mat');

results = cell(length(light_intensities), 1);
t_results = cell(length(light_intensities), 1);

for i = 1:length(light_intensities) %[output:group:86e7e1c3]
    J_hv = light_intensities(i);
    fprintf('   仿真 %d/%d: 光强 = %.1f photons/μm²/s\n', i, length(light_intensities), J_hv); %[output:4fe54552]
    
    % 设置当前光强
    params.Jhv = J_hv;
    
    % 运行完整仿真（让derivatives函数内部处理光刺激时序）
    [t_full, Y_full] = ode15s(@dY_dt, [0, t_total], Y_steady_state, options);
    
    t_results{i} = t_full;
    results{i} = unpack_solution_to_results(t_full, Y_full, J_hv);

end %[output:group:86e7e1c3]

fprintf('\n4. 打印关键时间点的数据...\n'); %[output:5181dddb]
analyze_and_print_results(results, t_results, light_intensities); %[output:804f4991]

toc; %[output:8ef6fb38]
%%
%[text] 绘图
tic;

fprintf('4. 绘制结果...\n'); %[output:1851e0f6]
plot_final_results_figure(results, t_results,[0, 5]); %[output:6ab496de]



fprintf('仿真完成！\n'); %[output:3ca4b6b5]

toc; %[output:25e70fd0]

